import './App.css';
import SignInForm from './Components/SignInForm';
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";


function App() {
  return (
    <div className="bg-image">
      <Router>
    <Routes>
    <Route path="/" element={<SignInForm />} />
    <Route path="register" element={<SignInForm />} />

    </Routes>


      </Router>


    </div>
  );
}

export default App;
